import React from 'react'

import { SettingsIcon } from './icons'

export default class extends React.Component {
  render () { return (
    <div class="bg-red-500 grid grid-cols-3">
      <h1>蒸気の博物館</h1>
      <input></input>
      <div class="p2">
        <SettingsIcon class="h-8"/>
      </div>
    </div>
  ) }
}
